from unittest import TestCase
import SampleResourceInventoryEvaluationScripts.war_runner.reliability.evaluate_svc_quotas_services as svc

class Testevaluate_svc_quotas_services(TestCase):
    def test_setup(self):
        s = svc.evaluate_svc_quotas_services()
        quota_change_history = s.setup("us-east-1")
        self.assertEquals(0,len(quota_change_history['RequestedQuotas']))


    def test_evaluate(self):
        s = svc.evaluate_svc_quotas_services()
        quota_change_history = s.setup("us-east-1")
        responses = s.evaluate(quota_change_history)
        self.assertEquals(0,len(responses))
